import styled from 'styled-components';
import {Blueprint, Container, Title1, Ps4Controller} from '../index';

const Etiqueta = styled.div`
    width: 303px;
    height: 303px;
    border: 1px solid #5500ff;
    border-radius: 50%;
`;

const EtiquetaConProps = styled.div`
    width: 303px;
    height: 303px;
    border: 1px solid #ff0055;
    border-radius: 50%;
`;

const Texto = styled.p`
    font-size: 20px;
    margin: 16px 0px;
`;

const AclaracionSuperImportante = styled.p`
    font-size: 24px;
    padding: 16px;
    color: red;
`;

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <Container>
                <h3>¿Que es styled components?</h3>
                <Texto>
                    Es una libreria que nos permite crear un componente al mismo tiempo que
                    definimos sus estilos a partir de cualquier etiqueta.
                </Texto>
                <Texto>
                    Además de esto nos permite escribir CSS como nos envia el gran oraculo W3C.
                </Texto>
                <Texto>Definimos un nuevo componente y le damos estilos.</Texto>
                <Etiqueta></Etiqueta>
                <Texto>¿Podemos darle props y cambiar su estado visual?</Texto>
                <EtiquetaConProps propiedad={true}></EtiquetaConProps>
                <AclaracionSuperImportante>
                    No se olviden de la semantica !! -.- y la accesibilidad que proporciona cada
                    etiqueta
                </AclaracionSuperImportante>
                <a alt="esto es un link" href="sarasa">
                    {' '}
                    esto es un link
                </a>
            </Container>
        );
    }
}

export default Main;
